- (NSArray *)searchEmojis:(NSString *)searchString
{
    NSPredicate *filter = [NSPredicate predicateWithFormat:searchString];
    return [self.allEmojis filteredArrayUsingPredicate:filter];
}

- (NSArray *)emojisForCategory:(int)category
{
    NSPredicate *filter = [NSPredicate predicateWithFormat:[self predicateStringForCategory:category]];
    return [self.allEmojis filteredArrayUsingPredicate:filter];
}

- (NSArray *)emojisForPage:(int)page inCategory:(int)category withColumns:(int)cols andRows:(int)rows
{
    NSUserDefaults *d = [NSUserDefaults standardUserDefaults];
    NSPredicate *filter = [NSPredicate predicateWithFormat:[self predicateStringForCategory:category]];
    NSArray *tabEmojis;
    
    if ([d integerForKey:@"emojiSorting"] > 1 && ![d boolForKey:@"hideOldEmojis"]) {
        
        NSMutableArray *newEmojis = [[self searchEmojis:[NSString stringWithFormat:@"category = %i AND hidden = YES", category]] mutableCopy];
        NSMutableArray *oldEmojis = [[self searchEmojis:[NSString stringWithFormat:@"category = %i AND hidden = NO", category]] mutableCopy];

        if ([d integerForKey:@"emojiSorting"] == 2) {
            
            [newEmojis addObjectsFromArray:oldEmojis];
            tabEmojis = newEmojis;
            
        } else {
            
            [oldEmojis addObjectsFromArray:newEmojis];
            tabEmojis = oldEmojis;
    
        }
        
        newEmojis = nil;
        oldEmojis = nil;
    
    } else {
        
        tabEmojis = [self.allEmojis filteredArrayUsingPredicate:filter];
        
    }
    
    d = nil;
    filter = nil;
        
    NSRange range;
    int totalEmojis = cols * rows;
    range.location = ((page + 1) * totalEmojis) - totalEmojis;
    if (range.location + totalEmojis > tabEmojis.count)
         range.length = tabEmojis.count - range.location;
    else range.length = totalEmojis;
    
    return [tabEmojis subarrayWithRange:range];
}

- (NSString *)predicateStringForCategory:(int)category
{
    NSMutableString *str = [NSMutableString stringWithString:@""];
    NSUserDefaults *d = [NSUserDefaults standardUserDefaults];
    
    [str appendFormat:@"category = %i", category];
    
    if ([d boolForKey:@"hideOldEmojis"])
        [str appendString:@" AND hidden = YES"];
    d = nil;
    
    return (NSString *)str;
}

- (int)totalPagesForCategory:(int)category withColumns:(int)cols andRows:(int)rows
{
    NSArray *emojis = [self emojisForCategory:category];
    int totalEmojis = cols * rows;
    int totalPages = (emojis.count / totalEmojis);
    if (emojis.count % totalEmojis != 0) totalPages++;
    emojis = nil;
    
    return totalPages;
}

